jQuery(window).load(function() {
    equalizer();
    jQuery(window).resize(equalizer);
});
      
function equalizer(){
    width=jQuery(window).width();
    if(width>=768){
        jQuery('.row-equal').equalizer({child:'.col-equal.col-xs-12,.col-equal.col-xs-11'});
    }
    if(width>=992){
        jQuery('.row-equal').equalizer({child:'.col-equal.col-sm-12'});
    }
}


// Navbar sticky
function navbar_sticky_data_top(){
    var elem = jQuery('#nav .navbar-header');
    if (jQuery('#nav').hasClass('navbar-fixed-top')) return;
    var offset = elem.offset();
    //elem.attr('data-top', offset.top);
    elem.attr('data-top', offset.top+elem.height());
}
function navbar_sticky(){
    var elem = jQuery('#nav .navbar-header');

    if (!elem.attr('data-top')) navbar_sticky_data_top();
    if (elem.attr('data-top') <= jQuery(this).scrollTop() && !jQuery('#menu-principale').hasClass('in') && !jQuery('#menu-principale').hasClass('collapsing')){
        jQuery('#nav').addClass('navbar-fixed-top');
        jQuery('#header').addClass('fixed');
    }else if(jQuery('#header').hasClass('fixed') && !jQuery('#menu-principale').hasClass('in') && !jQuery('#menu-principale').hasClass('collapsing')){
        jQuery('#nav').removeClass('navbar-fixed-top');
        jQuery('#header').removeClass('fixed');
    }
}

jQuery(window).load(function(){
    // Sticky nav
    jQuery(document).on('scroll scrollstart',navbar_sticky);
    jQuery(window).resize(navbar_sticky_data_top);
    navbar_sticky();
    
    
    jQuery('#home-header a.tab-link').on('show.bs.tab', function(e){
        e.preventDefault();
        if(jQuery('.tab-pane.active').length>0){
            if(jQuery('.tab-pane.active').attr('id')!=jQuery(e.target).attr('href').substring(1)){
                jQuery('#home-header .tab-pane.active').slideUp(500,function(){
                    jQuery(this).removeClass('active');
                    jQuery(jQuery(e.target).attr('href')).slideDown().addClass('active');
                });
            }
        }else jQuery(jQuery(e.target).attr('href')).slideDown().addClass('active');
        
        scroll_to('#home-header',e);
    });
});

function scroll_to(id,e){
    jQuery("html,body").animate({
        scrollTop: jQuery(id).offset().top + 100
    }, 400);
    e.preventDefault();
}


jQuery(document).ready(function(){
    jQuery('.helan-slider').slick({
        autoplay: true,
        autoplaySpeed: 3000,
        lazyLoad: 'progressive',
        cssEase: 'linear',
        dots: true,
        arrows : false
    });
    
    jQuery('.search-form-link').on('click',function(e){ 
        e.preventDefault(); 
        jQuery('#search-form').css({ display : 'block'});
        jQuery('#filter').css({ overflow:'hidden'});
        if(jQuery(window).width()<768) jQuery('#filter').css({ height: jQuery('#search-form').outerHeight()+'px'});
        setTimeout(function(){ jQuery('#search-form').addClass('open'); },50);
    });
    jQuery('.search-form-close').on('click',function(e){ 
        e.preventDefault();
        jQuery('#search-form').removeClass('open');
        setTimeout(function(){ 
            jQuery('#search-form').css({ display : 'none'});
            jQuery('#filter').css({ height:'auto', overflow:'visible'});
        },600);
    })
    jQuery('.selectpicker').selectpicker();
    
    jQuery('.gallery').lightGallery({
       selector: '.thumbnail',
       mode: 'lg-fade',
       fullScreen:false,
       download:false,
       hash:false
    });
    
    jQuery('.prodotto-voti a').hover(function(){
        var parent=jQuery(this).parent('.prodotto-voti');
        parent.find('.hover').removeClass('hover');
        var vote=parseInt(jQuery(this).addClass('hover').attr('data-voto'));
        for(var i=1;i<vote;i++) parent.find('a[data-voto="'+i+'"]').addClass('hover');
    });
    
    jQuery('.prodotto-voti a').click(function(e){
        var that=this;
        e.preventDefault();
        jQuery.ajax({
            url: '/prodotti/vota/',
            data: {id_prodotto : jQuery(this).attr('data-id_prodotto'),  voto : jQuery(this).attr('data-voto') },
            success: function(response){
                var parent=jQuery(that).parent();
                parent.find('a').remove();
                parent.find('.thankyou').addClass('active');
            }
        });
    });
    
    jQuery('[data-toggle="tooltip"]').tooltip();
    
    jQuery( "#data-di-nascita" ).datepicker({ dateFormat: 'dd/mm/yy' });

});

